CommonData.BannerCustomCSS:
#onetrust-banner-sdk {
    display: none;
}

#onetrust-banner-sdk.ot-wo-title #onetrust-group-container {
    margin-top: 10px;
}

#onetrust-banner-sdk .ot-optout-signal {
    font-size: .82em;
    background-color: transparent;
}

#onetrust-banner-sdk #onetrust-policy-text {
    padding-top: 0;
}

#onetrust-banner-sdk .shortNotice {
    display: none;
}

#onetrust-banner-sdk #onetrust-close-btn-container {
    right: 0;
    top: 0;
}

#onetrust-banner-sdk .ot-close-icon {
    background-image: none !important;
}

#onetrust-banner-sdk .ot-close-icon::before {
    content: '\2716';
    position: absolute;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    color: #fff;
    font-size: 18px;
}

#onetrust-banner-sdk #onetrust-button-group-parent {
    padding-bottom: 0;
}

#onetrust-banner-sdk .banner-actions-container {
    display: flex;
}

#onetrust-banner-sdk #onetrust-accept-btn-handler:last-child,
#onetrust-banner-sdk #onetrust-reject-all-handler:last-child {
    margin-right: 0;
}

@media only screen and (max-width: 425px) {

    #onetrust-banner-sdk #onetrust-policy-text {
        text-align: center;
        width: calc( 100% - 40px );
    }

    #onetrust-banner-sdk.otFloatingRoundedCorner {
        margin: 10px;
        width: 100%;
        max-width: calc( 100% - 20px );
        left: 0;
        bottom: 0;
        border-radius: 10px;
    }

    #onetrust-banner-sdk .longNotice {
        display: none;
    }

    #onetrust-banner-sdk .shortNotice {
        display: initial;
    }

}

CommonData.PCCustomCSS:
#onetrust-pc-sdk #ot-pc-desc br {
    display: none;
}

#onetrust-pc-sdk #ot-pc-desc .privacy-notice-link {
    display: inline-block;
    margin: 0;
}

#onetrust-pc-sdk .ot-always-active {
    color: #15768D;
}

#onetrust-pc-sdk .ot-switch {
    width: 48px;
    height: 28px;
}

#onetrust-pc-sdk .ot-switch-nob {
    background-color: #DADADA;
    border-radius: 16px;
    box-shadow: inset 0px 0px 10px 1.5px rgb(0 0 0 / 10%);
}

#onetrust-pc-sdk .ot-tgl input:checked+.ot-switch .ot-switch-nob {
    background-color: #15768D;
    border: 0;
    box-shadow: inset 0px 0px 10px 1.5px rgb(0 0 0 / 10%);
}

#onetrust-pc-sdk .ot-switch-nob::before {
    height: 22px;
    width: 22px;
    bottom: 2px;
    left: 2px;
    background-color: #fff;
    border-radius: 16px;
    box-shadow: 1px 2px 5px rgb(0 0 0 / 10%);
}

#onetrust-pc-sdk .ot-tgl input:checked+.ot-switch .ot-switch-nob::before {
    background-color: #fff;
    box-shadow: 1px 2px 5px rgb(0 0 0 / 10%);
    bottom: 3px;
}
